import React from 'react';
import './ExpenseItem.css';

const ExpenseItem = ({expense}) => {
    let month = expense.date.toLocaleDateString('en-us', { month:"long"})
    let date = expense.date.toLocaleDateString('en-us', { weekday:"long",  day:"numeric"})
    let year = expense.date.toLocaleDateString('en-us', { year:"numeric"})

  return (
    <div className="expense-item">
      <div>{ date}</div>
      <div className="expense-item__description">
        <h2>{expense.title}</h2>
        <p>{Math.random()}</p>
        <div className="expense-item__price">${expense.amount}</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
